INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 102301, 24, 0.0, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 0.0, 2, 10046, 24001, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 102301, 24, 2.21, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 0.0, 2, 10046, 24002, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 102301, 24, 0.0, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 0.0, 2, 10046, 24003, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 192201, 24, 1.99, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 0.0, 1, 10046, 24004, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 192201, 24, 2.21, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 0.0, 2, 10046, 24005, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 192201, 24, 3.33, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 0.0, 1, 10046, 24006, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 192301, 24, 0.0, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 0.0, 2, 10046, 24007, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 192301, 24, 2.68, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 0.0, 2, 10046, 24008, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 192301, 24, 0.0, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 0.0, 2, 10046, 24009, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 192501, 24, 0.0, 1, "やった！", 501, 0.0, 1, 10046, 24010, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 192501, 24, 0.0, 1, "勝ったよ！", 502, 0.0, 1, 10046, 24011, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 192501, 24, 0.0, 1, "いい調子！", 503, 0.0, 1, 10046, 24012, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 5.33, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 0.0, 2, 10046, 24013, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 6.85, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 0.0, 2, 10046, 24014, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 3.0, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 0.0, 2, 10046, 24015, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ダイチ", 192401, 24, 6.11, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 0.0, 2, 10046, 24016, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ダイチ", 192401, 24, 6.75, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 0.0, 2, 10046, 24017, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ダイチ", 192401, 24, 0.0, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 0.0, 2, 10046, 24018, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ハツネ", 113401, 24, 4.52, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 0.0, 1, 10046, 24019, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ハツネ", 113401, 24, 3.89, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 0.0, 1, 10046, 24020, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ハツネ", 113401, 24, 13.49, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 0.0, 2, 10046, 24021, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("カヤ", 106501, 24, 3.17, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 0.0, 2, 10046, 24022, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("カヤ", 106501, 24, 4.42, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 0.0, 2, 10046, 24023, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("カヤ", 106501, 24, 2.89, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 0.0, 1, 10046, 24024, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 102301, 24, 3.71, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 0.0, 3, 10046, 24025, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 192201, 24, 5.1, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 0.0, 1, 10046, 24026, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 192301, 24, 4.34, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 0.0, 3, 10046, 24027, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 192501, 24, 0.0, 1, "いい勝負だったよ\nまたやろうね", 521, 0.0, 1, 10046, 24028, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 5.62, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, -360.0, 2, 10046, 24029, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 9.58, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, -360.0, 2, 10046, 24030, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 0.0, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, -360.0, 2, 10046, 24031, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 9.13, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, -360.0, 1, 10046, 24032, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 113501, 24, 8.27, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, -360.0, 2, 10046, 24033, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59");
